                    cName: "nav-links"
                },
                {
                    title: "Home",
                    url: "#",
                    cName: "nav-links"
                }
            ]
            }
        }

    render() {
        console.log(this.state.MenuItems)
        return(
            <nav className="NavbarItems">
                <h1 className="navbar-logo">React</h1>
                <div className="menu=icon">

                </div>
